import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Ndata from "./Ndata";

ReactDOM.render(
  <>
    <h4 className="heading_style">Top 5 Naats in 2023</h4>

    <App
      pic={Ndata[0].pic}
      cat={Ndata[0].cat}
      tit={Ndata[0].tit}
      link={Ndata[0].link}
      dlink={Ndata[0].dlink}
    />

    {Ndata.map(ncard)}
  </>,
  document.getElementById("root")
);
